"""# Gráfico de Pontos - Conjunto de Dados Numéricos: Iris

![Iris](https://uploaddeimagens.com.br/images/004/626/664/full/iris-dataset.png?1696420025)

Importando os dados

*Use px.data. para acessar um banco de dados plotly*
"""

iris = px.data.iris()
iris.head()

"""![image.png](data:image/png;base64,)

Renomeando as colunas


*Use df.rename(columns={'x':'y', 'x1':'y1',...}) para alterar o nome das colunas x para y*
"""

iris = iris.rename(columns={"sepal_length":"comprimento_sepala",
                            "sepal_width":"largura_sepala",
                            "petal_length":"comprimento_petala",
                            "petal_width":"largura_petala",
                            "species":"espécie",
                            "species_id":"id_espécie"})

iris.head()

"""Informação dos dados

*Use df.info() para obter mais informações de seus dados, como número de linhas, colunas, valores nulos e tipo dos dados*
"""

iris.info()

"""Resumo estatístico

*Use df.describe() para obter um relatório estatístico rápido de seus dados numéricos, como média, medianas, moda, mínimos, máximos, etc*
"""

iris.describe().T

"""Plotando o gráfico

*Use px.scatter(data_frame=df, x='coluna_x', y='coluna_y') para plotar um gráfico de pontos a partir de um data frame*
"""

fig = px.scatter(data_frame = iris,
                 x = "comprimento_petala",
                 y = "largura_petala")
fig.show()

"""Aplicando cor

*Insira o parâmetro color="coluna_cor" para inserir cor ao gráfico*
"""

fig = px.scatter(data_frame = iris,
                  x= "comprimento_petala",
                  y = "largura_petala",
                  color = "espécie")

fig.show()

"""Aplicando simbolos

*Insira o parâmetro symbol="coluna_simbolo" para inserir símbolos ao gráfico*
"""

fig = px.scatter(data_frame = iris,
                  x= "comprimento_sepala",
                  y = "largura_sepala",
                  color = "espécie",
                  symbol= "espécie"
                  )

fig.show()

"""Aplicando tamanhos

*Insira o parâmetro size="coluna_tamanho" para inserir tamanho ao gráfico*
"""

fig = px.scatter(data_frame = iris,
                  x= "comprimento_petala",
                  y = "largura_petala",
                  color = "espécie",
                  symbol="espécie",
                  size="comprimento_sepala")

fig.show()

"""Mapa de cor

*Um dicionário {'variável_1':'cor_1', 'variável_2':'cor_2'...} pode ser criado para inserir cores de sua preferência*
"""

mapa_cor_iris = {"setosa":"black",
                 "versicolor":"yellow",
                 "virginica":"white"}

fig = px.scatter(data_frame = iris,
                  x= "comprimento_petala",
                  y = "largura_petala",
                  color = "espécie",
                  color_discrete_map = mapa_cor_iris,
                  symbol="espécie",
                  size="comprimento_sepala")

fig.show()

